Ang huling araw ng Linggo_INDIE FILM_2006(DVDRip)


Ang Huling Araw ng Linggo spans a week in a life of seven individuals with interconnected narratives. Domeng is involved in networking or multi-level marketing business and plans to encourage his estranged daughter Luna to join in this unscrupulous business. Luna is abandoned by her husband and son so she asks help from her mother Aling Tess. Aling Tess is a land lady who lives alone and fancies a young male boarder named Kulas. Kulas is a grocery store employee who aspires to become a store manager to impress Julie. Julie is a laundry shop attendant who is obsessed with a male costumer named Brian. Brian is a nurse in a local hospital who wants to work abroad so he persuades his girlfriend Sally to provide for his &quot;fixer&quot; fees. An accounting graduate who failed to pass the board exam for two consecutive years, Sally enters Domeng's networking business in the hopes of proving her worth. When she found out that networking is a scam Sally plans to take revenge on Domeng. The film illustrates the interconnectedness of our lives, a cycle of random events in which the decisions we make are as important as the choices we didn't take.


